&nbsp;</span></strong><strong><span style="font-family:Carlito; letter-spacing:0.35pt;">to&nbsp;</span></strong><strong><span style="font-family:Carlito;">identify and&nbsp;</span></strong><strong><span style="font-family:Carlito; letter-spacing:0.1pt;">address&nbsp;</span></strong><strong><span style="font-family:Carlito;">potential safety concerns, creating a safer learning environment for&nbsp;</span></strong><strong><span style="font-family:Carlito; letter-spacing:0.1pt;">students&nbsp;</span></strong><strong><span style="font-family:Carlito; letter-spacing:-0.15pt;">and&nbsp;</span></strong><strong><span style="font-family:Carlito;">staff. This rigorous process is&nbsp;</span></strong><strong><span style="font-family:Carlito; letter-spacing:0.15pt;">part&nbsp;</span></strong><strong><span style="font-family:Carlito;">of our&nbsp;</span></strong><strong><span style="font-family:Carlito; letter-spacing:0.15pt;">commitment to&nbsp;</span></strong><strong><span style="font-family:Carlito;">preventing school shootings&nbsp;</span></strong><strong><span style="font-family:Carlito; letter-spacing:-0.15pt;">and&nbsp;</span></strong><strong><span style="font-family:Carlito;">enhancing</span></strong><strong><span style="font-family:Carlito; letter-spacing:-0.7pt;">&nbsp;</span></strong><strong><span style="font-family:Carlito; letter-spacing:-0.15pt;">safety.</span></strong></p>
